function getCookie(t){let e=null;if(document.cookie&&""!==document.cookie){const n=document.cookie.split(";");for(let o=0;o<n.length;o++){const r=n[o].trim();if(r.substring(0,t.length+1)===t+"="){e=decodeURIComponent(r.substring(t.length+1));break}}}return e}function load(element,url){let xmlhttp;xmlhttp=window.XMLHttpRequest?new XMLHttpRequest:new ActiveXObject("Microsoft.XMLHTTP"),xmlhttp.onreadystatechange=function(){if(xmlhttp.readyState===XMLHttpRequest.DONE)if(200===xmlhttp.status){element.innerHTML=xmlhttp.responseText;const allScripts=element.getElementsByTagName("script");for(let n=0;n<allScripts.length;n++)eval(allScripts[n].innerHTML)}else alert("Error")},xmlhttp.open("GET",url,!0),xmlhttp.send()}function React(t,e){let n=document.querySelector(`#form-reaction-${t}`),o=n.getAttribute("method"),r=n.getAttribute("action"),c={urlhash:t,react_slug:e},l=new XMLHttpRequest;l.open(o,r,!0),l.setRequestHeader("Content-type","application/json"),l.setRequestHeader("X-Requested-With","XMLHttpRequest"),l.setRequestHeader("X-CSRFToken",getCookie("csrftoken")),l.onreadystatechange=function(){l.readyState===XMLHttpRequest.DONE&&(200===l.status?load(document.querySelector(`#form-reaction-${t}`),`/reaction/react?urlhash=${t}`):alert("ERROR in Submitting Reaction!"))},l.send(JSON.stringify(c))}document.addEventListener("DOMContentLoaded",(()=>{document.querySelectorAll("[id^='form-reaction-']").forEach((function(t){const e=t.id.replace("form-reaction-","");load(document.querySelector(`#form-reaction-${e}`),`/reaction/react?urlhash=${e}`)}))}));